import React from 'react'
import { Logo, HeaderContainer, A } from './styles'

const Header = ({children}) => (
  <HeaderContainer>
    <A href='/'>
      <Logo
        style={{ textDecoration}}
        title="Gym Club Logo">Peak Scout</Logo>
    </A>
    {children}
  </HeaderContainer>


)

export default Header
